-- Name: addstudentfee(character varying, integer, character varying, character varying, numeric, character varying, character); Type: FUNCTION; Schema: public; Owner: fabricefemencha
--

CREATE FUNCTION public.addstudentfee(in_connid character varying, in_userid integer, in_type character varying, in_method character varying, in_amount numeric, in_reference character varying, in_locale character) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_userid INTEGER;
    v_orgid INTEGER;
    v_fees JSON;
    au VARCHAR(9216);
    v_error VARCHAR(255);
BEGIN
    CALL log_activity('fees','add',in_connid,CONCAT('_H:',in_connid),FALSE);
    CALL verifyprivilege(in_connId, 'ADDFEES');

    v_userid := connid2userid(in_connid);
	v_orgid := userid2orgid(v_userid);

    IF active_year(v_orgid) = 0 THEN
        v_error := (SELECT fetchError(in_locale,'calTermNoActYear')) ;
		RAISE EXCEPTION '%', v_error USING HINT = v_error;
    END IF;

