--
-- Name: fetcherror(character varying, character varying); Type: FUNCTION; Schema: public; Owner: fabricefemencha
--

CREATE FUNCTION public.fetcherror(in_locale character varying, in_errkey character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE 
    v_error VARCHAR(255) DEFAULT NULL;
BEGIN
    IF in_locale = 'en' OR in_locale = 'en_US' THEN
        v_error := (SELECT erren FROM errormessages WHERE errkey=in_errkey);
    ELSEIF in_locale = 'fr' OR in_locale = 'en_FR' THEN
        v_error := (SELECT errfr FROM errormessages WHERE errkey=in_errkey);
    ELSE
        v_error := (SELECT erren FROM errormessages WHERE errkey=in_errkey);
    END IF;
    RETURN v_error;
END; $$;


