    IF v_roles IS NULL THEN
        v_roles := '[]';
    END IF;

    au := CONCAT('{"error":false,"result":{"status":200,"value":',v_roles,'}}');

    CALL log_activity('roles','remove',in_connid,CONCAT('Deleted. rid:',in_roleid,' for org:', v_orgid),TRUE);

    RETURN au;
END; $$;


