-- Name: setdefaultmarks(integer, integer, integer); Type: PROCEDURE; Schema: public; Owner: fabricefemencha
--

CREATE PROCEDURE public.setdefaultmarks(IN in_classid integer, IN in_subjectid integer, IN in_examid integer)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_student JSON;
    v_userid INTEGER;
    v_orgid INTEGER;
    i INTEGER;
    v_yearid INTEGER;
    v_error VARCHAR(255);
BEGIN
    v_student := (SELECT json_agg(s.userid) FROM students s JOIN classsubjects cs ON s.classid = cs.classid WHERE cs.classid = in_classid AND cs.subjectid = in_subjectid); -- Get the students subject
    IF JSON_ARRAY_LENGTH(v_student) > 0 THEN
        FOR i IN SELECT * FROM JSON_ARRAY_ELEMENTS(v_student)
        LOOP
            IF NOT EXISTS(SELECT * FROM examresults WHERE userid = i AND subjectid = in_subjectid AND examid = in_examid) THEN
                INSERT INTO examresults (userid, subjectid, examid, mark) VALUES (i, in_subjectid, in_examid, 0.00); 
            END IF;
        END LOOP;
    END IF;
END; $$;


ALTER PROCEDURE public.setdefaultmarks(IN in_classid integer, IN in_subjectid integer, IN in_examid integer) OWNER TO fabricefemencha;

--
-- Name: setdefaultmarksforexamination(character varying, integer, character); Type: PROCEDURE; Schema: public; Owner: fabricefemencha
--

CREATE PROCEDURE public.setdefaultmarksforexamination(IN in_connid character varying, IN in_examid integer, IN in_locale character)
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_classrooms JSON;
    v_classsubjects JSON;
    v_userid INTEGER;
    v_orgid INTEGER;
    i JSON;
    v_yearid INTEGER;
    v_error VARCHAR(255);
BEGIN
    CALL log_activity('classrooms','setDefaultMarks',in_connid,CONCAT('_H:',in_connid),FALSE);

    v_userid := connid2userid(in_connid);
	v_orgid := userid2orgid(v_userid);
    v_yearid := active_year(v_orgid);

    v_classrooms := (SELECT json_agg(t) FROM (SELECT c.classid, cs.subjectid FROM classrooms c JOIN classsubjects cs ON c.classid = cs.classid WHERE c.orgid = v_orgid AND cs.yearid = v_yearid) AS t); -- Get all classrooms
    IF  JSON_ARRAY_LENGTH(v_classrooms) > 0 THEN
        FOR i IN SELECT * FROM JSON_ARRAY_ELEMENTS(v_classrooms)
        LOOP 
           CALL setdefaultmarks((i->>'classid')::int, (i->>'subjectid')::int, in_examid);
        END LOOP;
    ELSE
        v_error := (SELECT fetchError(in_locale,'calExamNoClassTeachers')) ;
        RAISE EXCEPTION '%', v_error USING HINT = v_error;
    END IF;
END; $$;


