--
-- Name: validate_ip_addr(character varying, character varying); Type: PROCEDURE; Schema: public; Owner: fabricefemencha
--

CREATE PROCEDURE public.validate_ip_addr(IN p_connid character varying, IN p_ipaddr character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
  IF NOT EXISTS (SELECT * FROM userlogins WHERE connectionid=p_connid AND remotehost=p_ipaddr) THEN
    -- RAISE EXCEPTION 'IP address changed.' USING HINT = 'Have you switch network?';
    RAISE EXCEPTION 'IP address changed. Have you switch network?' USING HINT = 'IP address changed. Have you switch network?';
  END IF;
END; $$;


ALTER PROCEDURE public.validate_ip_addr(IN p_connid character varying, IN p_ipaddr character varying) OWNER TO fabricefemencha;

--
-- Name: verifyprivilege(character varying, character varying); Type: PROCEDURE; Schema: public; Owner: fabricefemencha
--

CREATE PROCEDURE public.verifyprivilege(INOUT in_connid character varying, IN in_perm character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
    CALL checkloginstatusa(in_connid,0);
    CALL checkpermission(connid2userId(in_connId),  in_perm);
END; $$;


