--
-- Name: wheel(integer, character varying, boolean); Type: FUNCTION; Schema: public; Owner: fabricefemencha
--

CREATE FUNCTION public.wheel(in_userid integer, in_pwd character varying, authenticate boolean) RETURNS boolean
    LANGUAGE plpgsql
    AS $$
DECLARE 
    ret BOOLEAN DEFAULT FALSE;
BEGIN
    IF is_db_admin() THEN
		ret := TRUE;
	ELSE BEGIN
			IF EXISTS(SELECT * FROM userroles WHERE userid=in_userid AND roleid=rolename2id('wheel', userId2orgid(in_userid))) THEN
				ret := CASE authenticate
								WHEN FALSE THEN TRUE
								ELSE authenticateUser(in_userid, in_pwd) END;
			END IF;
		END;
	END IF;
	RETURN ret;
END; $$;


ALTER FUNCTION public.wheel(in_userid integer, in_pwd character varying, authenticate boolean) OWNER TO fabricefemencha;

